import React from 'react';
import Navbar from '../../components/Nav/Nav';
import './home.css';

const HomePage = () => {
  const scrollToNextPage = () => {
    window.scrollTo({
      top: window.innerHeight,
      behavior: 'smooth'
    });
  };

  return (
    <div>
      <div className='full-viewport-div'>
        <h1>Splash Home Page</h1>
        <div className='scroll-down-arrow' onClick={scrollToNextPage}>
          <section id='section04' class='demo'>
            <h1>Scroll Down Button #4</h1>
            <a href='#section05'>
              <span></span>Scroll
            </a>
          </section>
        </div>
      </div>
      <div style={{ height: '100vh', backgroundColor: '#28a745' }}>
        {/* Next page content goes here */}
        <h2>Next Page</h2>
      </div>
    </div>
  );
};

export default HomePage;
